import React from 'react';
import * as AiIcons from "react-icons/ai";
import * as IoIcons from "react-icons/io";

export const AdminSidebarData = 
[
    {
        title: 'Students',
        path: '/',
        icon: <AiIcons.AiFillHome />,
        cName : 'nav-text01'
    },
    {
        title: 'Faculties',
        path: '/faculty',
        icon: <IoIcons.IoIosPaper />,
        cName : 'nav-text01'
    },
    {
        title: 'Courses',
        path: '/courses',
        icon: <IoIcons.IoIosBook />,
        cName : 'nav-text01'
    },
    {
        title: 'User',
        path: '/user',
        icon: <AiIcons.AiOutlineUserAdd />,
        cName : 'nav-text01'
    },
    {
        title: 'Admin',
        path: '/admins',
        icon: <AiIcons.AiOutlineUser />,
        cName : 'nav-text01'
    },
    {
        title: 'TimeTables',
        path: '/timetable',
        icon: <AiIcons.AiFillClockCircle />,
        cName : 'nav-text01'
    },
    {
        title: 'Assets',
        path: '/assets',
        icon: <AiIcons.AiFillAlert />,
        cName : 'nav-text01'
    },
    {
        title: 'Admin Enrollments',
        path: '/adminenrollments',
        icon: <AiIcons.AiFillAlert />,
        cName : 'nav-text01'
    },
    {
        title: 'Enrollments Applied',
        path: '/enrollmentsApplied',
        icon: <AiIcons.AiFillAlert />,
        cName : 'nav-text01'
    },    {
        title: 'Enrollments Accepted',
        path: '/enrollmentsAccepted',
        icon: <AiIcons.AiFillAlert />,
        cName : 'nav-text01'
    },    {
        title: 'Enrollments Completed',
        path: '/enrollmentsCompleted',
        icon: <AiIcons.AiFillAlert />,
        cName : 'nav-text01'
    },
    
    {
        title: 'Performance Graph',
        path: '/graph',
        icon: <AiIcons.AiFillSignal />,
        cName : 'nav-text01'
    },
    {
        title: 'Documents',
        path: '/adminDocumentsAPI',
        icon: <AiIcons.AiFillFolder />,
        cName : 'nav-text01'
    },
    {
        title: 'Office Documents',
        path: '/adminofficeDocumentsAPI',
        icon: <AiIcons.AiFillFolder />,
        cName : 'nav-text01'
    },
    {
        title: 'Marks',
        path: '/marks',
        icon: <AiIcons.AiOutlineBook/>,
        cName : 'nav-text01'
    },
    {
        title: 'Change Password',
        path: '/adminChangePassword',
        icon: <AiIcons.AiOutlineLock />,
        cName : 'nav-text01'
    }, {
        title: 'Admin Jobs',
        path: '/adminJobs',
        icon: <AiIcons.AiOutlineLock />,
        cName : 'nav-text01'
    }, {
        title: 'Faculty Jobs',
        path: '/facultyJobs',
        icon: <AiIcons.AiOutlineLock />,
        cName : 'nav-text01'
    },
    {
        title: 'Members',
        path: '/membersStatus',
        icon: <AiIcons.AiOutlineLock />,
        cName : 'nav-text01'
    }, 
    {
        title: 'Courses Enrolled',
        path: '/adminCourseEnrolled',
        icon: <AiIcons.AiOutlineLock />,
        cName : 'nav-text01'
    }, 
    {
        title: 'Invoice',
        path: '/invoice',
        icon: <AiIcons.AiOutlineLock />,
        cName : 'nav-text01'
    }
    
    

    
]
